description:
Placing a 21st century spin on a science fiction classic, SCI FI&amp;#039;s contemporized version of Flash Gordon follows the all-new adventures of Flash (Eric Johnson) and his companions, Dale Arden (Gina Holden), Baylin (Karen Cliche) and Dr. Hans Zarkov (Jody Racicot). Ordinary people thrust into extraordinary circumstances, they find themselves as Earth&amp;#039;s last line of defense against the forces of the merciless dictator Ming (John Ralston).

